const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name}, you are {props.age}</p>
    </div>
  )
}

const App = () => {
  const name = "Valeri";
  const age = 26;
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="Valeri" age={age}/>
      <Hello name="Joku"/>

    </div>
  )
}

export default App
